class LoginResponse {  final int status;  final String accessToken;  final String tokenType;  final int expiresIn;  LoginResponse({    required this.status,    required this.accessToken,    required this.tokenType,    required this.expiresIn,  });  factory LoginResponse.fromJson(Map<String, dynamic> json) {    return LoginResponse(      status: json['status'] as int,      accessToken: json['access_token'] as String,      tokenType: json['token_type'] as String,      expiresIn: json['expires_in'] as int,    );  }  Map<String, dynamic> toJson() {    return {      'status': status,      'access_token': accessToken,      'token_type': tokenType,      'expires_in': expiresIn,    };  }}